  assemblies:
  - Google.Api.Gax
  namespace: Google.Api.Gax
  summary: "\nClass for representing and working with resource names.\n"
  remarks: "\n<p>\nA resource name is represented by a <xref href=\"Google.Api.Gax.PathTemplate\" data-throw-if-not-resolved=\"false\"></xref>, an assignment of resource IDs to parameters in\nthe template, and an optional service name. This class allows the service name and resource IDs to be\nmodified, but only within the same template.\n</p>\n"
